oxy_webhelp_navlinks = {"sql_server_database_protection-d22872e28512":{"topics":[{"title":"Changing the default log backup path","shortdesc":"<p class=\"shortdesc\">Edit the default log backup properties to change the log backup location for a         protected Microsoft SQL Server database.<\/p>","href":"saas\/mssql_setting_default_log_backup_frequency.html","attributes":{"data-id":"mssql_setting_default_log_backup_frequency"},"menu":{"hasChildren":false},"tocID":"mssql_setting_default_log_backup_frequency-d22872e28523","topics":[]},{"title":"Protecting databases through a parent object","shortdesc":"<p class=\"shortdesc\">Assign an SLA Domain to a Windows Server host, Microsoft SQL Server instance, or         individual databases to protect Microsoft SQL Server databases. Derived assignments from a         host or instance allow uniform management and protection of database groups.<\/p>","href":"saas\/mssql_protecting_dbs_through_parent_obj.html","attributes":{"data-id":"mssql_protecting_dbs_through_parent_obj"},"menu":{"hasChildren":false},"tocID":"mssql_protecting_dbs_through_parent_obj-d22872e28534","topics":[]},{"title":"Protecting individual Microsoft SQL Server databases","shortdesc":"<p class=\"shortdesc\">To provide data management and protection for an individual Microsoft SQL Server database,         assign that database to an SLA Domain.<\/p>","href":"saas\/mssql_protecting_individual_dbs.html","attributes":{"data-id":"mssql_protecting_individual_dbs"},"menu":{"hasChildren":false},"tocID":"mssql_protecting_individual_dbs-d22872e28545","topics":[]},{"title":"Removing Microsoft SQL Server database protection ","shortdesc":"<p class=\"shortdesc\">Remove an SLA Domain assignment from a Microsoft SQL Server database to prevent         policy-driven snapshots and log backups for the database. Both derived and individual SLA         Domain assignments can be removed.<\/p>","href":"saas\/mssql_removing_sla_domain_assignment.html","attributes":{"data-id":"mssql_removing_sla_domain_assignment"},"menu":{"hasChildren":false},"tocID":"mssql_removing_sla_domain_assignment-d22872e28556","topics":[]},{"title":"Taking an on-demand snapshot ","shortdesc":"<p class=\"shortdesc\">Create an on-demand snapshot of the databases on a Microsoft SQL Server instance or         of individual Microsoft SQL Server database.<\/p>","href":"saas\/mssql_taking_on_demand_snapshot.html","attributes":{"data-id":"mssql_taking_on_demand_snapshot"},"menu":{"hasChildren":false},"tocID":"mssql_taking_on_demand_snapshot-d22872e28567","topics":[]},{"title":"Taking a group on-demand snapshot task","shortdesc":"<p class=\"shortdesc\">Take a single on-demand snapshot of a group of Microsoft SQL Server databases to use         fewer resources than are required to take an on-demand snapshot of each individual database         in the group.<\/p>","href":"saas\/mssql_taking_group_on_demand_snapshot_task.html","attributes":{"data-id":"mssql_taking_group_on_demand_snapshot_task"},"menu":{"hasChildren":false},"tocID":"mssql_taking_group_on_demand_snapshot_task-d22872e28578","topics":[]},{"title":"Creating an on-demand T-log backup","shortdesc":"<p class=\"shortdesc\">Create an on-demand T-log backup to protect records that were written to the         transaction log after the most recent transaction log backup.<\/p>","href":"saas\/mssql_creating_a_t_log_backup.html","attributes":{"data-id":"mssql_creating_a_t_log_backup"},"menu":{"hasChildren":false},"tocID":"mssql_creating_a_t_log_backup-d22872e28589","topics":[]}]}};